import React from "react";
import Contributors from "./Contributors";

function TableList({ contributorsList, error }) {
  console.log("in table list", contributorsList);
  return (
    <>
      {!contributorsList && (
        <p>Please enter a repository to find it's collaborators</p>
      )}
      {contributorsList && contributorsList.length === 0 && (
        <img
          alt="loading"
          src="https://trello-attachments.s3.amazonaws.com/5f7c8ab9b80a927f1f047d20/300x300/a35a54d93989cc51ca3226d2220477b3/Gif_loaging.gif"
        ></img>
      )}
      {contributorsList && contributorsList.user && (
        <ul>
          {contributorsList.map((user) => (
            <Contributors user={user} key={user.id} />
          ))}
        </ul>
      )}
      {contributorsList && !contributorsList.user && (
        <p>{contributorsList.message}</p>
      )}
      {error && <p>There has been an error: {error}</p>}
    </>
  );
}

export default TableList;
